(201, 2, 'khóa học fix bug', '1652774381.png', 1000000, 2, '<h2 style=\"overflow-wrap: break-word; margin: 0px 0px 13.2px; padding: 10.8px 0px 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-weight: normal; font-stretch: inherit; font-size: 24px; line-height: 1.4; font-family: \'Roboto Condensed\'; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; color: #ea1e30; letter-spacing: 0.3px; background-color: #ffffff;\"><span id=\"Bug_la_gi_Debug_la_gi_Fixbug_la_gi\" style=\"margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility;\">Bug là gì? Debug là gì? Fixbug là gì?</span></span></h2>\r\n<blockquote class=\"wp-block-quote\" style=\"margin: 0px 0px 25px; padding: 20px 50px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: Roboto; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; quotes: none; overflow-wrap: break-word; position: relative; z-index: 1; color: #222222; letter-spacing: 0.3px; background-color: #ffffff;\">\r\n<p style=\"overflow-wrap: break-word; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility;\"><em style=\"margin: 0px; padding: 0px; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility;\">Bug là gì?</span> Bug là những lỗi phần mềm trong chương trình hoặc hệ thống máy tính làm cho kết quả không chính xác hoặc không hoạt động như mong muốn. – Theo Wikipedia</em></p>\r\n</blockquote>\r\n<p style=\"overflow-wrap: break-word; margin: 0px 0px 18px; padding: 6px 0px 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: Roboto; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; color: #221f20; letter-spacing: 0.3px; background-color: #ffffff;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility;\">Debug</span> là quá trình tìm kiếm và phát hiện lỗi trong phần mềm trước khi launching, đưa sản phẩm đến tay người dùng. Debug diễn ra ngay sau khi những dòng code đầu tiên được viết và tiếp tục được thực hiện cho đến khi kết hợp với những unit khác của lập trình tạo thành một sản phầm phần mềm hoàn chỉnh.</p>\r\n<p style=\"overflow-wrap: break-word; margin: 0px 0px 18px; padding: 6px 0px 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: Roboto; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; color: #221f20; letter-spacing: 0.3px; background-color: #ffffff;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility;\">Fixbug</span> (sửa lỗi) là quá trình triển khai ngay sau debug, nhằm duy trì hoặc nâng cao chất lượng sản phẩm.</p>\r\n<h2 style=\"overflow-wrap: break-word; margin: 0px 0px 13.2px; padding: 10.8px 0px 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-weight: normal; font-stretch: inherit; font-size: 24px; line-height: 1.4; font-family: \'Roboto Condensed\'; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; color: #ea1e30; letter-spacing: 0.3px; background-color: #ffffff;\"><span id=\"Cac_loai_bug_pho_bien_nhat\" style=\"margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility;\">Các loại bug phổ biến nhất</span></span></h2>\r\n<p style=\"overflow-wrap: break-word; margin: 0px 0px 18px; padding: 6px 0px 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: Roboto; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; color: #221f20; letter-spacing: 0.3px; background-color: #ffffff;\">Theo <a style=\"margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; text-decoration-line: none; outline: 0px; cursor: pointer; color: #ea1e30; transition: all 300ms ease 0s;\" href=\"https://www.browserstack.com/guide/types-of-software-bugs\" target=\"_blank\" rel=\"noreferrer noopener\">Browserstack</a>, có 6 loại bug phổ biến mà các developer thường gặp phải nhất:</p>\r\n<p style=\"overflow-wrap: break-word; margin: 0px 0px 18px; padding: 6px 0px 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: Roboto; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; color: #221f20; letter-spacing: 0.3px; background-color: #ffffff;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility;\">1. Bug chức năng (Functional Bug)</span></p>\r\n<p style=\"overflow-wrap: break-word; margin: 0px 0px 18px; padding: 6px 0px 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: Roboto; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; color: #221f20; letter-spacing: 0.3px; background-color: #ffffff;\">Các lỗi chức năng được liên kết với chức năng của một thành phần phần mềm cụ thể.  Ví dụ: Nút <em style=\"margin: 0px; padding: 0px; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility;\">Đăng nhập </em>không cho phép người dùng đăng nhập, nút <em style=\"margin: 0px; padding: 0px; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility;\">Thêm vào giỏ hàng</em> không cập nhật giỏ hàng, hộp tìm kiếm không phản hồi truy vấn của người dùng, v.v.</p>\r\n<p style=\"overflow-wrap: break-word; margin: 0px 0px 18px; padding: 6px 0px 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: Roboto; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; color: #221f20; letter-spacing: 0.3px; background-color: #ffffff;\">Nói một cách dễ hiểu, bất kỳ thành phần nào trong ứng dụng hoặc trang web không hoạt động như dự kiến đều được gọi là bug chức năng.</p>\r\n<p style=\"overflow-wrap: break-word; margin: 0px 0px 18px; padding: 6px 0px 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: Roboto; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; color: #221f20; letter-spacing: 0.3px; background-color: #ffffff;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility;\">2. Bug logic (Logical Bug)</span></p>\r\n<p style=\"overflow-wrap: break-word; margin: 0px 0px 18px; padding: 6px 0px 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: Roboto; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; color: #221f20; letter-spacing: 0.3px; background-color: #ffffff;\">Thông thường, lỗi logic sẽ làm gián đoạn quy trình làm việc dự kiến của phần mềm và khiến ứng dụng hoạt động không chính xác. Những bug này có thể dẫn đến hành vi phần mềm không mong muốn và thậm chí là sự cố đột ngột.</p>\r\n<p style=\"overflow-wrap: break-word; margin: 0px 0px 18px; padding: 6px 0px 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: Roboto; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; color: #221f20; letter-spacing: 0.3px; background-color: #ffffff;\">Lỗi logic chủ yếu xảy ra do developer diễn giải sai logic của ứng dụng. Ví dụ về lỗi logic bao gồm:</p>\r\n<ul style=\"overflow-wrap: break-word; margin: 0px 0px 18px 25px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: Roboto; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; list-style-position: inside; list-style-image: initial; position: relative; color: #221f20; letter-spacing: 0.3px; background-color: #ffffff;\">\r\n<li style=\"margin: 0px; padding: 0px 0px 6px; border: 0px; font: inherit; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; list-style-type: disc; list-style-position: inside; position: relative;\">Gán giá trị cho biến sai</li>\r\n<li style=\"margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; list-style-type: disc; list-style-position: inside; position: relative;\">Chia hai số thay vì cộng chúng với nhau dẫn đến kết quả không mong muốn</li>\r\n</ul>\r\n<p style=\"overflow-wrap: break-word; margin: 0px 0px 18px; padding: 6px 0px 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: Roboto; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; color: #221f20; letter-spacing: 0.3px; background-color: #ffffff;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility;\">3. Bug quy trình làm việc (Workflow Bug)</span></p>\r\n<p style=\"overflow-wrap: break-word; margin: 0px 0px 18px; padding: 6px 0px 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: Roboto; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; color: #221f20; letter-spacing: 0.3px; background-color: #ffffff;\">Lỗi quy trình làm việc được liên kết với hành trình của người dùng (điều hướng) của một ứng dụng phần mềm. Ta lấy ví dụ về một trang web để người dùng điền biểu mẫu về lịch sử y tế của họ. Sau khi điền vào biểu mẫu, người dùng có ba tùy chọn để lựa chọn:</p>\r\n<ol style=\"overflow-wrap: break-word; margin: 0px 0px 18px 25px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: Roboto; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; list-style-position: inside; list-style-image: initial; color: #221f20; letter-spacing: 0.3px; background-color: #ffffff;\">\r\n<li style=\"margin: 0px; padding: 0px 0px 6px; border: 0px; font: inherit; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; list-style-type: decimal; list-style-position: inside;\">Lưu</li>\r\n<li style=\"margin: 0px; padding: 0px 0px 6px; border: 0px; font: inherit; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; list-style-type: decimal; list-style-position: inside;\">Lưu và thoát</li>\r\n<li style=\"margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; list-style-type: decimal; list-style-position: inside;\">Trang trước</li>\r\n</ol>\r\n<p style=\"overflow-wrap: break-word; margin: 0px 0px 18px; padding: 6px 0px 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: Roboto; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; color: #221f20; letter-spacing: 0.3px; background-color: #ffffff;\">Từ các tùy chọn có sẵn, nếu người dùng nhấp vào “Lưu và thoát”, người dùng có ý định lưu thông tin đã nhập và sau đó thoát. Tuy nhiên, nếu nhấp vào nút Lưu và Thoát dẫn đến việc thoát khỏi biểu mẫu mà không lưu thông tin, đó chính là đến bug liên quan đến quy trình làm việc.</p>\r\n<p style=\"overflow-wrap: break-word; margin: 0px 0px 18px; padding: 6px 0px 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: Roboto; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; color: #221f20; letter-spacing: 0.3px; background-color: #ffffff;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility;\">4. Bug cấp đơn vị (Unit Level Bug)</span></p>\r\n<p style=\"overflow-wrap: break-word; margin: 0px 0px 18px; padding: 6px 0px 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: Roboto; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; color: #221f20; letter-spacing: 0.3px; background-color: #ffffff;\">Các bug ở cấp độ đơn vị rất phổ biến và chúng thường dễ sửa hơn. Khi các module ban đầu của các thành phần được phát triển, developer sẽ thực hiện unit testing để đảm bảo rằng các đoạn code nhỏ đang hoạt động như mong đợi. Đây là giai đoạn mà các developer gặp phải nhiều bug khác nhau không được phát hiện trong các giai đoạn viết mã.</p>\r\n<p style=\"overflow-wrap: break-word; margin: 0px 0px 18px; padding: 6px 0px 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: Roboto; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; color: #221f20; letter-spacing: 0.3px; background-color: #ffffff;\">Ví dụ: Nếu bạn cần tạo biểu mẫu một trang, unit test sẽ xác minh xem tất cả các trường đầu vào có chấp nhận đầu vào thích hợp hay không và các nút hoạt động đúng chức năng hay không. Trong trường hợp một trường không chấp nhận các ký tự hoặc số thích hợp, các nhà phát triển sẽ gặp phải bug cấp đơn vị.</p>\r\n<p style=\"overflow-wrap: break-word; margin: 0px 0px 18px; padding: 6px 0px 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: Roboto; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; color: #221f20; letter-spacing: 0.3px; background-color: #ffffff;\">Các bug ở cấp độ đơn vị dễ xác định hơn khi developer chỉ cần xử lý một lượng code tương đối nhỏ. Developer có thể theo dõi lỗi chính xác và fix các bug này ngay lập tức.</p>\r\n<p style=\"overflow-wrap: break-word; margin: 0px 0px 18px; padding: 6px 0px 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: Roboto; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; color: #221f20; letter-spacing: 0.3px; background-color: #ffffff;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility;\">5. Bug tích hợp cấp hệ thống (System-Level Integration Bug)</span></p>\r\n<p style=\"overflow-wrap: break-word; margin: 0px 0px 18px; padding: 6px 0px 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: Roboto; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; color: #221f20; letter-spacing: 0.3px; background-color: #ffffff;\">Bug tích hợp cấp hệ thống chủ yếu xuất hiện khi hai hoặc nhiều đơn vị code do các developer khác nhau viết không tương tác với nhau. Những bug này chủ yếu xảy ra do sự mâu thuẫn hoặc không tương thích giữa hai hoặc nhiều thành phần.</p>\r\n<p style=\"overflow-wrap: break-word; margin: 0px 0px 18px; padding: 6px 0px 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: Roboto; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; color: #221f20; letter-spacing: 0.3px; background-color: #ffffff;\">Thông thường, những lỗi như vậy rất khó theo dõi và fix vì các nhà phát triển cần kiểm tra một đoạn code lớn hơn. Chúng cũng tốn nhiều thời gian để tái tạo.</p>\r\n<p style=\"overflow-wrap: break-word; margin: 0px 0px 18px; padding: 6px 0px 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: Roboto; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; color: #221f20; letter-spacing: 0.3px; background-color: #ffffff;\">Sự cố tràn bộ nhớ và giao diện không phù hợp giữa giao diện người dùng ứng dụng và cơ sở dữ liệu là những ví dụ phổ biến về lỗi tích hợp cấp hệ thống.</p>\r\n<p style=\"overflow-wrap: break-word; margin: 0px 0px 18px; padding: 6px 0px 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: Roboto; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; color: #221f20; letter-spacing: 0.3px; background-color: #ffffff;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility;\">6. Bug ngoài giới hạn (Out of Bound Bug)</span></p>\r\n<p style=\"overflow-wrap: break-word; margin: 0px 0px 18px; padding: 6px 0px 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: Roboto; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; color: #221f20; letter-spacing: 0.3px; background-color: #ffffff;\">Lỗi ngoài giới hạn xuất hiện khi người dùng hệ thống tương tác với giao diện người dùng theo cách không chủ ý. Những lỗi này xảy ra khi người dùng cuối nhập một giá trị hoặc một tham số nằm ngoài giới hạn sử dụng ngoài ý muốn.</p>\r\n<p style=\"overflow-wrap: break-word; margin: 0px 0px 18px; padding: 6px 0px 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: Roboto; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; color: #221f20; letter-spacing: 0.3px; background-color: #ffffff;\">Ví dụ: Người dùng nhập một số rất lớn hoặc rất nhỏ hoặc nhập giá trị đầu vào của một kiểu dữ liệu không xác định.</p>\r\n<p style=\"overflow-wrap: break-word; margin: 0px 0px 18px; padding: 6px 0px 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: Roboto; vertical-align: baseline; text-size-adjust: 100%; -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; color: #221f20; letter-spacing: 0.3px; background-color: #ffffff;\">Những bug này thường xuất hiện dưới dạng xác thực trong quá trình kiểm tra chức năng của ứng dụng web hoặc mobile app.</p>', '2022-05-17 00:59:41', '2022-05-17 01:01:52');
